let start=datetime(2020);
let end=now();
let timeGrain=5m;
let dataset=requests
| where timestamp > start and timestamp < end
| where client_Type != "Browser" ;
dataset
| summarize count_=sum(itemCount), avg_duration_ms=avg(duration), percentiles(duration, 50, 95, 99) by operation_Name
| union(dataset
| summarize count_=sum(itemCount), avg_duration_ms=avg(duration), percentiles(duration, 50, 95, 99)
| extend operation_Name="Overall")
| order by count_ desc
| limit 7

